(5050, 'ENG', 158, 201911, 'P', 18, NULL, 'Title: \"Studies in Questions -- Introduction to Digital Humanities\" \r\nCrosslist with CSC 186\r\nCan fill with first-year students\r\nThis course is to be cross-listed (or co-located) with ENG 240. Total capacity 21.\r\nCapacity for ENG 240 8 students (any level)\r\nRestrictions on CSC 186: 1 senior, 1 junior, 4 sophomores,  4 freshmen,  3 incoming students.', 'ginterj', 1, 14, 'A', NULL, NULL, '1', 0),
(5051, 'ENG', 152, 201911, 'P', 15, NULL, NULL, NULL, 0, 39, 'B', NULL, NULL, '1', 0),
(5052, 'ENG', 150, 201911, 'Q', 15, NULL, 'ENG 110--Introduction to Literature: Telling (about) time in film and literature\r\n\r\nThough \"time\" may seem like an obvious and natural concept, a modern Western notion of it first emerged in late nineteenth-century Europe and Britain together with developments in science and the introduction of temporal standardization to facilitate rail travel.  This sense of “time” came to be defined in very particular terms, eventually overshadowing and crowding out other ways of experiencing and being in the world, other “temporalities.” At this same moment, the concept of time travel appeared in literature, and it has gripped the human imagination in stories and films ever since.  In this course we’ll read and watch a number of such narratives, starting with excerpts from one of the earliest, H.G. Wells’s 1895 novella, The Time Machine, and zooming across the next century and a quarter to consider Ava DuVernay’s 2018 film A Wrinkle of Time.  Along the way, we’ll explore Octavia Butler’s 1979 novel Kindred, that combines time travel with the genre of the slave narrative, and German director Tom Tykwer\'s 1998 film, Run Lola Run, a loop narrative in which the protagonist Lola has 20 minutes to secure 200,000 Marks to save her boyfriend.  We’ll consider why such stories are so ubiquitous and why we find them so compelling.  But we will also learn about other ways time is fundamental to narrative—structurally, thematically, and ideologically.  Narrative literature and films are forms of art that unfold in time, but they are also forms that depend on an array of artistic devices to represent and create a sense of time.  We’ll consider what impact writers’ and filmmakers’ choices can have and why they make choices about manipulating the order, duration, and frequency of events, considering Lisa Kron\'s 1996 autobiographical play 2.5 Second Ride and German director Michael Verhoeven\'s 1990 film, The Nasty Girl, both of which deal with coming to terms with the Nazi past.  Finally, throughout the course, we’ll ask questions about what exactly time itself is, how we experience time in our lives, how our contemporary understanding of time has been culturally and historically determined, and what narratives such as Chris Eyre’s 1998 film Smoke Signals can teach us about a wide range of temporalities that have been marginalized. ', NULL, 0, 2, 'A', NULL, NULL, '1', 0),
