(6226, 'PSY', 406, 202012, 'ZZZ', 37, NULL, 'This class will be completely asynchronous. This will also be a \"double section\" of PSY100 so it is counting as 2 courses for Sarah and I have tentatively set the cap at 37 to reflect that.', 'williamsw', 0, NULL, 'A', NULL, NULL, '2.0', 1),
(6227, 'PSY', 406, 202020, 'ZZZ', 37, NULL, 'This class will be completely asynchronous. This will also be a \"double section\" of PSY100 so it is counting as 2 courses for Alison and I have tentatively set the cap at 37 to reflect that.', 'williamsw', 0, NULL, 'B', NULL, NULL, '2.0', 1),
(6229, 'PSY', 1639, 202012, 'ZZZ', 16, NULL, 'This course will be offered fully asynchronous.', 'williamsw', 0, NULL, 'None', NULL, NULL, '1.0', 1),
(6230, 'PSY', 419, 202012, '9L', 1, NULL, 'This will count as 1.75 of Wendy\'s load. The course cap needs to be set at zero (not 1 as required by the system above) because there are 12 students who MUST have the class to graduate in spring so I will be adding them to the course by overload so that no other students take those slots. I will communicate with the students who need the course to graduate in spring about the process for enrolling. Because the pandemic cap is 7 on this class, taking 12 students will count as 1.75 of Wendy\'s load, with the remaining .25 of her load picked up through extra students in PSY209.  This course will meet synchronously on Tuesdays and Fridays from 10-11:50am.', 'williamsw', 0, NULL, 'None', NULL, NULL, '1.0', 1),
(6231, 'PSY', 410, 202020, '9C', 20, NULL, 'This course is off-campus but will use synchronous times from 10-10:50am but only on Tuesdays and Fridays. This will count as 1.25 faculty load for Wendy so that cap is set at that level. This is because 12 students need her PSY424 Senior Research course when only 7 are possible to handle online in a 7 week term. As such, she\'s taking on all 12. While not a \"double section\" it is close so she\'s taking a few more in the lab (usually set at 16) to compensate.', 'williamsw', 0, NULL, 'None', NULL, NULL, '1.0', 1),
