(6295, 'ENG', 1475, 202011, 'ZZZ', 20, NULL, 'This course was submitted to become a catalogue course in Fall 2020\r\n\r\nMW 2:40-4:30 PM\r\nJason is flexible about rooms: any room in Knapp Hall; seminar room in Draper; a room with movable tables in Emery. ENG/CSC 186 must be in the same building as GSTR 410 because they are back-to-back; the same room for these courses would be great.\r\n\r\nNotes from CS: This course is to be co-located with CSC 186: Intro to Digital Humanities. Total capacity in both courses: 20. Capacity for ENG 186: 8 students. Restrictions on CSC 186: 1 senior, 1 junior, 3 sophomores, 4 freshmen, 3 incoming students. Also, students who have completed CSC 236 should not be allowed to register for this course.\r\n', 'heggens', 1, 1, 'A', NULL, NULL, '1', 0),
