(1, 'REL', 1293, 201811, 'Q', 8, 'Ritual Spaces', 'AB 204 (Archaeology lab)', 'rameyj2', NULL, 0, NULL, 2, '1.000', '', 'Can go up to 16 for enrollment of NEW students', '', '', '', '', NULL, '1', 0),
