(7, 'CSC', 683, 201812, 'P', 16, 'Embedded Systems', 'This course must be in DT 104 due to the electronics needed.', 'steeles', NULL, 0, 46, 2, '1.000', 'A study on embedded systems and electronics.', 'CSC226', 'Systems category of the CIS major, all concentrations', '', '300 level CSC', '', NULL, '1', 0),
(9, 'WGS', 477, 201811, 'Q', 18, 'Gender Trouble: Philosophy of Gender', NULL, NULL, NULL, 1, NULL, 1, '', '', '', '', '', '', 'AAAW, Gender and Sexuality distribution credit for WGS major, ', '', '1', 0),
(10, 'COM', 661, 201811, 'B', 10, 'Radio Broadcasting', 'Radio Studio, and if the studio remains in Stephenson, the 122 is the preference.  If the studio moves to Draper this summer then a classroom in Draper would be preferred.', 'rameyj2', NULL, 0, NULL, 2, '1.000', 'The purpose of Radio Broadcasting is to introduce students to the workings of the radio industry and to provide some introductory training and work in radio broadcasting. We will discuss the history of the medium and the broadcasting industry it created. We will also cover how a radio station is run and learn basic techniques in live audio production and broadcasting.', '', 'Communication Major, Group 2 or elective', '', 'Broadcast Journalism minor, production elective', '', 'A', '1', 0),
(11, 'COM', 661, 201811, 'F', 10, 'Radio Broadcasting', 'Radio Studio, and if the studio remains in Stephenson, the 122 is the preference. If the studio moves to Draper this summer then a classroom in Draper would be preferred.', 'rameyj2', NULL, 0, NULL, 2, '1.000', 'The purpose of Radio Broadcasting is to introduce students to the workings of the radio industry and to provide some introductory training and work in radio broadcasting. We will discuss the history of the medium and the broadcasting industry it created. We will also cover how a radio station is run and learn basic techniques in live audio production and broadcasting.', '', 'Group 2, elective', '', 'broadcast journalism, production elective', '', 'B', '1', 0),
(12, 'CSC', 499, 201811, 'E', 24, 'Intro to Digitial Humanities', NULL, 'rameyj2', NULL, 1, NULL, 2, '1.000', 'This course introduces digital and computational methods for the study of traditionally humanist objects, including letters, fiction, prose, maps, or other kinds of  documents. The course will involve substantial reading  as well as computer programming. Student projects will combine computer assisted methods and traditional humanities questions about authors, style, and how we understand literary works in a rich context, including historical, geographical, and cultural concerns, among others. Topics may include: text analysis and topic modeling, mapping and geocoding, and network analysis, among others. No prior knowledge of computer programming is expected. ', 'MAT012', 'Exploratory courses in the CIS major, all concentrations.', '', '', '', NULL, '1', 0),
(13, 'SOC', 1323, 201812, 'Q', 14, 'Intro to Latinx Studies: Policies, Ideologies, and Institutions (PSJ)', 'Draper for room', 'steeles', NULL, 1, NULL, 2, '', '', '', '', '', '', '', NULL, '1', 0),
(14, 'CFS', 497, 201811, 'K', 16, 'Nature Education and Young Children', 'A course fee of $20 is needed to provide transportation for four or more filed trips.', 'rameyj2', NULL, 0, NULL, 2, '1.000', 'This course focuses on assisting students to recognize, utilize and capitalize on opportunities to interact with young children in nature settings. Young children’s curiosity and nature’s diversity creates opportunities to learn about health, ecosystems, biology, food systems, astronomy, sustainability, economics, as well as develop cooperation, appreciation, sensitivity, creativity and wonder. Through a series of field experiences, observations at the Child Development Laboratory’s nature-scape playground, course readings, group projects and lectures, students will engage with nature, children, and each other while exploring a variety of disciplines. Emphasis will be placed on methods to engage children in exploration and inquiry leading to measurable outcomes. This course is applicable for students interested in teaching, working for summer camps, national or state parks, local parks and recreation offices, and anyone interested in children and nature.', '', '', 'This course will be a distribution course for the child development concentration.', 'This course will be a distribution course for the child development portion of the minor.', 'ALE', NULL, '1', 0),
(15, 'PHI', 1224, 201811, 'Q', 20, 'Gender Trouble:  Philosophy of Gender', NULL, 'pearsone', NULL, 1, NULL, 1, '1.000', 'What is gender?  What are genders?  Where does this concept, which influences and shapes all of our lives, come from?  Are lived experiences of gender consistent across time and place?  Do such things as race, class, sexuality, ability and age influence our understandings of gender?  Are femininity and masculinity necessarily binary?  Are we soon approaching a point in history where we can get rid of specific gender roles, gender expressions, and gender values?  This course will be an exploration of philosophy of gender, seeking to answer the above questions.  In order to do so, we will take a particularly philosophical approach to answering the above questions.  Along the way, we will also incorporate and analyze sources from history, psychology, sociology, biology, and pop culture in an effort to determine, from our own standpoints, the trouble with gender.', 'sophomore standing or successful completion of GSTR 110', 'gender perspective and elective  credit in WGS; elective credit in PHI', '', '', 'AAAW', NULL, '1', 0),
(16, 'PHI', 1216, 201811, 'C', 10, 'Minds and Bodies', NULL, 'rameyj2', NULL, 0, NULL, 2, '1.000', 'This course investigates the distinction between the mind and the body.  By reading and discussing both classical and contemporary sources, we will investigate the distinctly philosophical approach to understanding the relationship between thinking and feeling on the one hand, and the body and brain on the other.', NULL, 'elective credit', '', '', '', NULL, '1', 0),
(17, 'CFS', 497, 201812, 'Q', 12, 'Infant and Toddler Curriculum', NULL, 'steeles', NULL, 0, 12, 2, '1.000', '', 'CFS 130, ', '', 'This course should be counted in the Child Development distribution list', 'This course should be counted in the Child Development distribution list', '', NULL, '1', 0),
(18, 'BIO', 65, 201811, 'F', 18, 'Conservation Biology', 'Lab for this course will meet R 8:30 - 11:20 am in Cargill 170\r\n\r\nThis course was taught in Spring 2016.  The Department wil be proposing it as a catalog course after a successful second offering in Spring 2018.', 'rameyj2', NULL, 0, NULL, 2, '1.000', 'Conservation Biology is the scientific study of the phenomena that affect the loss, restoration, and maintenance of biological diversity. Topics covered include: 1) the impacts of species invasions,  habitat destruction and climate change on biodiversity, 2) conservation strategies developed to combat these threats, 3) how healthy, biologically diverse systems and biodiversity loss impact the human species and 4) a consideration of key economic and ethical tradeoffs of conservation practices. Special attention will be paid to current debate and controversy within this rapidly emerging field of study.', 'BIO 110 or permission of instructor', 'Counts as one of the \"plus four\" courses in the Biology major.', 'Counts in the General concentration', 'Counts as one of the five BIO courses for the Biology minor', 'none', NULL, '1', 0),
(19, 'HIS', 278, 201811, 'Q', 15, 'African American Activism', NULL, 'rameyj2', NULL, 1, NULL, 2, '', '', '', '', '', '', 'AAAW', NULL, '1', 0),
(20, 'ENG', 717, 201811, 'E', 15, 'Intro to Digital Humanities', NULL, 'rameyj2', NULL, 1, NULL, 2, '1.000', '', '', '', '', '', '', NULL, '1', 0),
