(22, 'HLT', 850, 201811, 'Q', 20, 'Medical Terminology', NULL, 'rameyj2', NULL, 0, NULL, 2, '', '', '', '', '', '', '', NULL, '1', 0),
(23, 'HHP', 258, 201811, 'E', 20, 'Introduction to Statistics in Human Performance', NULL, 'rameyj2', NULL, 0, NULL, 2, '', '', '', '', '', '', '', NULL, '1', 0),
(24, 'AFR', 521, 201811, 'P', 15, 'Underground Railroad and American Memory', NULL, 'rameyj2', NULL, 0, NULL, 2, '', '', 'GSTR 110', 'Elective ', '', 'Elective', 'AAAW', NULL, '1', 0),
(25, 'HHP', 258, 201811, 'O', 15, 'Personal Training Certification', NULL, 'rameyj2', NULL, 0, NULL, 2, '', '', '', '', '', '', '', NULL, '1', 0),
(26, 'LES', 1454, 201811, 'K', 15, 'The Fascist State', NULL, 'rameyj2', NULL, 0, NULL, 2, '1.000', '', '', '', '', '', '', NULL, '1', 0),
(27, 'HHP', 258, 201811, 'O', NULL, 'Personal Training Cert', NULL, 'rameyj2', NULL, 0, NULL, 2, '', '', '', '', '', '', '', 'A', '1', 0),
(29, 'GER', 176, 201812, 'F', 12, 'Deutsche Jugendliteratur', NULL, 'steeles', NULL, 0, NULL, 2, '1.000', 'The course concentrates on the German literature that is commonly read  to and by young children and adolescents.  An emphasis is placed on developing the four major skills: reading, listening, speaking, and writing and on German culture.  The course is taught in German.', 'GER 103', 'One of 7 advanced courses for the major', '', 'One of 5 advanced courses for the minor', '', NULL, '1', 0),
(30, 'THR', 1360, 201812, 'H', 20, 'Should be THR 286M - Non Profit Arts Managment', NULL, 'ginterj', NULL, 0, NULL, 2, '', 'Exploration of nonprofit arts management in the United States,  including theatre, visual arts, dance, and music.  Students will develop skills in management, leadership, marketing, fundraising, advocacy, and budgeting.  ', NULL, 'Can fulfill requirements of independent arts management majors.  ', 'Can fulfill the needs of THR majors whose focus is administration.  ', 'Can meet the 200-level or above requirements for BUS Minor.  ', '', 'A', '1', 0),
(31, 'MAT', 877, 201812, 'C', 20, 'Discrete Mathematics', 'Pilot course for new discrete math for MAT and CSC majors.', 'steeles', NULL, 0, NULL, 2, '1.000', 'Discrete mathematics is the study of mathematical structures and number systems which are discrete rather than continuous.  Selected topics include: counting techniques, graph theory, recurrence relations, logic, set theory, mathematical induction, Boolean algebra and other topics as time permits. Topics may emphasize applications to Computer Science. Prerequisite: Waiver or completion of MAT 012, non-credit for students who have completed MAT 415.', 'MAT 012 or waiver', 'Substitute for MAT 105 as required collateral in CSC major.', 'Substitute for MAT 105 as required collateral in CSC major.', '', 'PRQ', NULL, '1', 0),
(32, 'ART', 36, 201812, 'Q', 10, 'Special Topics in Ceramics', 'Course Title: Appalachian Ceramics \r\nWill be applying for a perspective - arts? AAAW?', 'steeles', NULL, 0, NULL, 2, '1.000', 'This course explores the aesthetics, technology, and science involved in the Appalachian tradition of bringing clay from the hills to the table, while guiding students through an examination of the historic and contemporary ceramic makers and cultures in the southern Appalachian Mountain region. \r\nA hands-on course, students will be asked to complete a series of projects in support of readings on traditional and contemporary topics on the Appalachian craft tradition. The history of hand-building and wheel-thrown techniques and practical applications will also be examined, as well as local clay prospecting and processing techniques. \r\nPrevious experience is not required for this course. \r\n', NULL, '', '', '', 'Arts Perspective', NULL, '1', 0),
(33, 'HHP', 258, 201812, 'O', 15, 'Exercise Testing & Prescription', NULL, 'steeles', NULL, 0, NULL, 2, '', '', '', '', '', '', '', NULL, '1', 0),
(34, 'HHP', 264, 201812, 'A', 25, 'Sport & Exercise Psychology', 'Add prerequisites and any additional details from the Special Topics form to be submitted.', 'steeles', NULL, 1, 57, 2, '1.000', 'Cross list with PSY', '', '', '', '', '', NULL, '1', 0),
(35, 'HLT', 850, 201812, 'A', 10, 'CPR Instructor', 'Course Fee:  $35 if American Red Cross CPR/AED & 1st Aid certified; $60 if not currently certified', 'steeles', NULL, 0, NULL, 2, '', '', '', '', '', '', '', NULL, '1', 0),
(36, 'REL', 1307, 201812, 'Q', 12, 'Ecofeminism in Modern Religious Thought', NULL, 'steeles', NULL, 1, NULL, 2, '', '', 'One previous humanities course or permission of the instructor.', 'Area III: Normative Studies of Religion', '', '', 'REL, AAAW', 'A', '1', 0),
(37, 'REL', 1301, 201812, 'O', 20, 'Ritual Studies', NULL, 'steeles', NULL, 0, NULL, 2, '', '', 'GSTR 110', 'Area III: Normative Studies of Religion', '', '', 'REL', NULL, '1', 0),
(38, 'ENG', 727, 201812, 'ZZZ', 12, 'Advanced Writing', NULL, 'steeles', NULL, 0, NULL, 2, '', '', 'ENG 124', '', '', '', '', 'A', '1', 0),
(39, 'APS', 556, 201812, 'K', 15, 'The Coal Wars', 'Needs to be held in Stephenson 122 (preferred) or 301A because the professor teaching the class is 73 & her office is in the building.', 'ginterj', NULL, 0, NULL, 2, '', 'APS 286/386: The West Virginia Mine Wars This course will explore the history and impact of the complicated and turbulent West Virginia Coal Wars (1888-1925), its foundational events, and lasting effects. Included will be studies of the impact of the industrial revolution and the growth of the land barons and capitalists, the Appalachian \"land grab\"and the development of a highly controlled feudal systems within the coal country. Emphasis will also be placed on the systematic exploitation of immigrants, recently-freed enslaved people, convict labor, and the descendents of early Appalachian settlers, as well as the federal and state government\'s tacit, often explicit, support of owners control and resistance to unionizing and regulations. Students taking this course for advanced credit will be expected to complete deeper studies of each topic as well as prepare and present class presentations/lessons designed to deepen the understanding of selected topics (for example, the broad form deed, Esau scrip,).', 'GSTR 210', '', '', 'APS Minor: would fulfill one of the two misc APS class requirements for the minor. ', 'AAAW', NULL, '1', 0),
(40, 'PSJ', 1273, 201812, 'Q', 14, 'Introduction to Latinx ', NULL, 'ginterj', NULL, 1, NULL, 2, '', '', '', '', '', '', '', NULL, '1', 0),
(41, 'HIS', 278, 201812, 'Q', 14, 'History of Christianity in the 2/3 World', NULL, 'ginterj', NULL, 0, NULL, 2, '', '', '', '', '', '', 'Religion\r\nInternational Non-Western', NULL, '1', 0),
(42, 'COM', 661, 201812, 'C', NULL, 'Nonviolent Communication', NULL, 'ginterj', NULL, 1, NULL, 2, '', '', '', '', '', '', '', NULL, '1', 0),
(43, 'PSY', 506, 201812, 'A', NULL, 'Exercise and Sport Psychology', NULL, 'ginterj', NULL, 1, NULL, 2, '', '', '', '', '', '', '', NULL, '1', 0),
(44, 'REL', 1301, 201812, 'P', 20, 'Religion, Climate Change, and the Global South', NULL, 'ginterj', NULL, 1, NULL, 2, '', '', '', '', '', '', '', NULL, '1', 0),
(45, 'THR', 1498, 201812, 'Q', 12, 'Screenwriting', NULL, 'steeles', NULL, 0, NULL, 2, '', 'Topics covered will include techniques for generating ideas, the drafting process, classical narrative structure, classical screenplay structure and craft, experimental and documentary approaches to writing for the moving image, dialogue and storyboarding. The course will rely equally on avant-garde approaches to screenwriting and historically canonized Hollywood approaches. Marginalized and historically underrepresented voices will be given full voice in this class. New forms will be encouraged.  Students will have the option finishing the course by writing and producing a 5-7 minute short film, a storyboard for a 10-15 minute short film or animation, a 15-20 minute radio play or podcast, or a 60-75pg screenplay in classic Three-Act structure.', 'GSTR 110', 'This course can fulfill requirements for the Independent Film Production Major and fulfill electives for Film Minor and Theatre Minor.  ', '', '', '', NULL, '1', 0),
(47, 'WGS', 477, 201812, 'Q', NULL, 'Ecofeminism', 'This should actually be REL 386.', 'ginterj', NULL, 1, NULL, 2, '', '', '', '', '', '', '', NULL, '1', 0),
(48, 'BIO', 65, 201812, 'E', 15, 'Ornithology', 'Will meet in MAC 170', 'ginterj', NULL, 0, 79, 2, '1.000', 'Natural history, morphology, physiology, and ecology of birds in conjunction with adaptive radiation and speciation during the Tertiary Period will be explored.  Ethological and physiological adaptations to feeding, reproduction and migration will be examined within the context of biogeography.  Laboratory exercises will emphasize species recognition through morphology, plumage and song.  Students will apply this information in the field to identify species found within the region.', 'BIO 113', 'Field course; plus-four distributive', 'N/A', 'Counts as one of four electives in the minor', 'N/A', NULL, '1', 0),
