(51, 'BUS', 619, 201812, 'A', 25, 'Deep Learning with Neural Networks using R', NULL, 'steeles', NULL, 1, NULL, 2, '1.000', 'Machine learning in general, and deep learning using neural networks, are taking an increasingly important role in our modern, digitally enabled society. These neural networks form the technologies behind self-driving vehicles, natural language processing (e.g., Siri and Alexa), advanced machine game playing (e.g., AlphaGo), ‘fake’ news detection, and medical diagnoses, to name but a few applications. This course begins with an understanding of how computers can learn to “see” and “read.” It then progresses into the design and construction of neural networks using sequential, recurrent, and convolutional architectures for the processing of visual images, text documents, and regression modeling. Students will use their laptops to build these networks using all open-source, free tools: the R programming language, the RStudio development environment, the Keras neural network package developed by Google researcher Francois Chollet, and the Tensorflow mathematical engine also developed at Google. The book for this course, Deep Learning in R, was written by Chollet and is available as an online LiveBook. The math in this course will be taught through the R program code, so math skills are kept to a minimum.', 'Any CSC 100 level or 200 level or BUS 114 and MAT 115 (or equivalent)', 'It meets the any 200 level or above requirement for the Finance, Management, and Marketing concentrations in Business Administration.  It can substitute for the BUS/CSC 328 or BUS/CSC 336 requirement for the Management Information Systems concentration in Business Administration.  For the Compute and Information Science major, for all concentrations, it will meet the requirement for one of the any three 300 level courses in CSC requirement.', 'It meets the any 200 level or above requirement for the Finance, Management, and Marketing concentrations in Business Administration.  It can substitute for the BUS/CSC 328 or BUS/CSC 336 requirement for the Management Information Systems concentration in Business Administration.  For the Compute and Information Science major, for all concentrations, it will meet the requirement for one of the any three 300 level courses in CSC requirement.', 'In the Business Administration minor it will meet the any two 200 level or above BUS courses.  In the  Computer Science minor it will meet one of the Three additional CSC courses requirement.', '', NULL, '1', 0),
(52, 'CSC', 683, 201812, 'A', 25, 'Deep Learning with Neural Networks using R', NULL, 'steeles', NULL, 1, NULL, 2, '1.000', 'Machine learning in general, and deep learning using neural networks, are taking an increasingly important role in our modern, digitally enabled society. These neural networks form the technologies behind self-driving vehicles, natural language processing (e.g., Siri and Alexa), advanced machine game playing (e.g., AlphaGo), ‘fake’ news detection, and medical diagnoses, to name but a few applications. This course begins with an understanding of how computers can learn to “see” and “read.” It then progresses into the design and construction of neural networks using sequential, recurrent, and convolutional architectures for the processing of visual images, text documents, and regression modeling. Students will use their laptops to build these networks using all open-source, free tools: the R programming language, the RStudio development environment, the Keras neural network package developed by Google researcher Francois Chollet, and the Tensorflow mathematical engine also developed at Google. The book for this course, Deep Learning in R, was written by Chollet and is available as an online LiveBook. The math in this course will be taught through the R program code, so math skills are kept to a minimum.', 'Any CSC 1xx or 2xx and MAT 115 (or equivalent)', '300-level CSC course in CIS Major\r\nBusiness Administration', 'All CIS Concentrations', '300-level CSC course in CIS Major\r\nBusiness Administration', 'PRQ', 'A', '1', 0),
