(55, 'BIO', 65, 201812, 'E', 20, 'Advances in Biomedical Research and Technology', NULL, 'ginterj', NULL, 0, 78, 2, '1.000', 'This is an upper level course that surveys cutting edge advancements in the field of medicine. The class focuses on new discoveries in biomedical research and technology, with a focus on products from translational and clinical research. Each topic is studied from different perspectives, including a historical background, methodology, how the new advancement represents a step forward in patient care, potential ethical/legal issues associated with the advancement, extrapolation on how the advancement might be modified or coopted to further medicine or other fields even further in the future and possible effect on human populations.', 'BIO 110 and either BIO 113 or BIO 114', 'Will fulfill one of two courses required within the BIO rubric in the “Plus Four” electives category  ', 'NA', 'Counts as one of the four electives in the minor.', 'NA', NULL, '1', 0),
