(60, 'PSJ', 1270, 201812, 'Q', 20, 'Introduction to Latinx (SOC)', NULL, 'rameyj2', NULL, 1, NULL, 2, '1.000', 'This course is designed to provide a general overview of Latino Studies through a Sociological lens. Throughout the course, we will draw from a combination of readings, lecture material, film, and current events to develop a keen understanding of the social, political, and historical context of Latinos in U.S. society. More specifically, we will explore topics such as nationality, race, borderlands, gender, and social movements to examine the forces shaping Latino experiences as well as the ways that Latinos resist and construct their own realities.', '', '', '', '', '', NULL, '1', 0),
(61, 'THR', 1498, 201812, 'H', 20, 'Non-Profit Arts Management', NULL, 'rameyj2', NULL, 0, NULL, 2, '1.000', 'Exploration of nonprofit arts management in the United States,  including theatre, visual arts, dance, and music.  Students will develop skills in management, leadership, marketing, fundraising, advocacy, and budgeting.', NULL, 'Can fulfill requirements of independent arts management majors.', 'Can fulfill the needs of THR majors whose focus is administration.', 'Can meet the 200-level or above requirements for BUS Minor.', '', NULL, '1', 0),
