(77, 'CFS', 497, 201911, 'P', 20, 'The Meaning of Adulthood', NULL, 'rameyj2', NULL, 0, 10, 2, '1.000', 'Rites of passage may mark an individual as an adult in a particular culture, but that might only be the beginning of the transition to being recognized as an adult by family and the government. At 18 you can vote, but not buy alcohol. In some cases you can stay on your parent’s insurance until you are 26 years old. So when are you an adult, and what does that mean? Becoming an adult is a developmental process impacted by family, society and cultural influences. This class will explore those factors, how they have changed over time, and how they influence individuals now as they seek to live meaningfully as adults. This course will address practical issues such as the financial, educational, and career decisions individuals must make as they enter early adulthood, and explore the developmental challenges adults face as described in later stages of Erik Erikson’s Psychosocial Developmental Theory. Students will be expected to engage in class discussions, and examine course material as it pertains to their own lives.', 'NA', 'None', 'Can count as a distribution class for the family studies or child development concentration.', 'Can count as a distribution class for the family studies or child development concentration.', 'None', 'None', '1', 0),
(78, 'CFS', 497, 201911, NULL, 20, 'Surfing the Silver Tsunami', NULL, 'rameyj2', NULL, 0, 10, 2, '1.000', 'Are you ready for the challenges and opportunities that are in store as our population gets increasingly older?  According to projections by the US Census Bureau, persons 65 years and older are expected to outnumber children in the US by 2035. From now until 2060, the proportion of older adults in the US is expected to increase from 15% to 24%.  Among all age groups, the number of those 85 years and older will increase the fastest.  In this course, the student will deepen their understanding of these unprecedented demographics, and reflect on the expected impact it will have during the course of the student’s adult life in areas of career opportunity, economics, welfare, health, family, finance, technology, and residence.  The student will also consider their own individual aging and life expectancy, and evaluate evidence on how to not only increase the years of their life but also optimize the life of their years.', 'GSTR 210 ', 'None', 'Can count as a distribution class for the family studies and child development concentration.', 'Can count as a distribution class for the family studies and child development concentration.', 'None', 'None', '1', 0),
(79, 'CFS', 497, 201911, 'P', 15, 'Human Services Job Market', NULL, 'rameyj2', NULL, 0, 12, 2, '1.000', 'Students will develop a portfolio of job market materials to assist them in securing entry-level human services employment or advancing into graduate studies.  Topics covered include resume and cover letter creation, identifying competencies, anticipating demand for social services in your desired location, tailoring materials to job ads, conducting online and offline job searches, mock interviews, and planning for extended job searches.  Students will craft materials and revise them through peer review.', 'GSTR 210, and either CFS 130, CFS 145, CFS 207 or CFS 221', 'None', 'This course can count as a distribution class for all three concentration areas in Child and Family Studies.', 'None', 'None', 'None', '1', 0),
(80, 'CFS', 639, 201911, 'ZZZ', 10, 'Early Childhood Practicum I', 'This course is a 0.5 credit course.\r\nThis course will meet Tuesday from 5:30 -7:30.\r\nThis course will meet in the CDL classroom.', 'rameyj2', NULL, 0, 9, 2, '0.500', 'An applied practicum for Child and Family Studies majors with a concentration in Child Development. This practicum is designed to support student learning about how to observe development of young children, document observations and interactions with children, and begin to plan appropriate experiences for young children. Students with significant labor experience at the Child Development Laboratory and who have completed some child development courses will meet weekly with the instructor to share, reflect, and problem-solve their classroom experiences utilizing principles taught in CFS courses, recommended best practices in early childhood education, NAEYC standards, and Kentucky IECE standards. Students will document children’s learning, reflect on their own implementation of best practice, and begin to plan appropriate experiences for children grounded in their observations and reflections.', 'CFS 130 and completed one term with a labor position at the CDL', 'None', 'This course can count in the child development distribution list', 'None', 'None', NULL, '1', 0),
(81, 'REL', 1307, 201911, 'C', 15, 'Queer Theology (WGS)', NULL, 'rameyj2', NULL, 1, 28, 2, '', 'By subverting conventional readings of the Christian tradition, queer theologians challenge common assumptions about what Christianity has to say for and about LGBTQ+ individuals. In this course, we will look at recent attempts by theologians and biblical scholars to reinterpret Christian teachings and texts using queer theory. In so doing, we will critically examine the way Christianity has historically been used to justify the oppression of LGBTQ+ people, consider the nature of theological construction, and explore the radical possibilities that a queer reading of Christianity presents for people of all orientations and identities.', 'GSTR 310', 'Meets the requirement of  required elective  course at the 200-level or above', 'Cultural Studies of Religion', 'One of four required REL elective courses', 'Religion and Women and Gender Studies', 'None', '1', 0),
(82, 'REL', 1301, 201911, 'O', 20, 'Christian Spirituality and Discipleship', NULL, 'rameyj2', NULL, 0, 35, 2, '1.000', 'A study of Christian spirituality and discipleship.  This course will examine the nature of Christian spirituality and discipleship in diverse expressions, exploring both inner dynamics and outward implications of Christian callings to faith, holiness, service, and justice in various cultures and societies.  ', '', 'One of the two required 200-level courses in REL.', '', '', '', 'None', '1', 0),
(83, 'THR', 1498, 201911, 'Q', 16, 'Queer Theatre', 'I am requesting the room that I teach in just an hour before due to classes being back to back.  Please assign the same rooms for THR 213 and 286 - Queer Theatre.  Both classes must have reliable A/V capabilities.  Please no residence halls.  ', 'rameyj2', NULL, 0, 28, 2, '1.000', 'An examination of the Queer dramatic literature and the political and social contexts that gave birth to the genre', 'None', 'May fulfill THR electives for the Theatre major and minor', 'none', 'May fulfill THR electives for the Theatre major and minor', 'none', 'A', '1', 0),
(84, 'THR', 1369, 201911, 'ZZZ', 9, 'Cosplay ', 'This class will take place on Saturday from 10-12:20 and a check in time on Friday from 4-5pm.  Cross listed with TAD (as it was during the fall of 2018)', 'rameyj2', NULL, 1, 62, 2, '1.000', 'This course will explore the basic practices and techniques used in theatrical costume design and construction as they apply to the area of cosplay. Students will select a character’s costume to replicate (with the approval of course instructor); develop a design and construction plan for the costume; construction the costume for the character; and document the entire process. Students will also assemble a materials and techniques sample book that will act as a reference guide during the course. The course may require\r\nsignificant out of class time for construction.', 'none', 'May fulfill the elective requirement for the THR major', 'none', 'May fulfill the elective requirement for the THR minor', 'none', 'A', '1', 0),
