(88, 'ART', 36, 201911, 'P', 16, 'The Anthropocene (SENS)', NULL, 'rameyj2', NULL, 1, NULL, 2, '1.000', ' In the past century, humans as a species have dramatically altered the Earth’s the atmospheric, geologic, hydrologic and biospheric systems– extinctions are increasing, plastics are found in the most remote areas, previously resilient economies are failing, and the earth’s biodiversity is in peril. With these changes, ecologists across disciplines are finding that human survival depends on our multifaceted relationships with untold numbers of other species–where what seemed to function independent of humanity suddenly is viewed as being deeply tangled together. As our technologies, both digital and biological, have begun to alter even what it means to be human, we will explore what it means to live in the Anthropocene, and how scientists, policy makers, artists, and political and ecological theorists are working to respond to its many implications. In addition to course texts, we will attempt to come to terms with our current epoch through the increasingly merging lens of the arts, sciences, policy, and broader ecological fields.', 'None', 'Studio Art ', '', 'SENS', '', 'A', '1', 0),
(92, 'CSC', 480, 201911, 'B', 24, 'Computing & Sustainable Systems', NULL, 'rameyj2', NULL, 0, 44, 2, '1.000', '', 'CSC 236', 'Systems Category', '', '', '', 'A', '1', 0),
