(95, 'THR', 1498, 201912, 'K', 12, 'Experimental Cinema', 'This class will either meet in the Musser Theatre (Jelkyl Drama Building) or in the Theatre classroom in Draper.  ', 'rameyj2', NULL, 0, NULL, 2, '', 'The course will focus on cinema as an art form, contextualizing avant-garde approaches to filmmaking against standardized film industry approaches. The films screened and readings studied in this course will focus on the American Avant Garde movement, but may also include examples from global film history. We will consider historic experimental approaches to filmmaking such as found footage, structuralism, direct animation and personal cinema. Opportunities for expanded cinema and hybrid forms will also be possible.', 'GSTR 110', 'This class can fulfill the elective for the THEATRE major and the independent FILM PRODUCTION major.  ', 'We do not have concentrations.  ', 'This class can fulfill the electives for the THEATRE MINOR and FILM PRODUCTION minor.  ', 'No perspectives.  ', 'A', '1', 0),
(96, 'REL', 1301, 201912, 'C', 22, 'Global Theologies of Liberation', 'This will be cross listed with PSJ.', 'steeles', NULL, 1, 27, 2, '1.000', 'This course will consider Christian liberation theologies from around the world, examining Black liberation theology, Latin American ecofeminist theology, and Asian postcolonial theology. We will also study Christian, Muslim, and Hindu liberative theologies that variously address disability, class, gender, and sexual identity.', 'GSTR 210', 'One course in Area III (Normative Studies)\r\nOne of the two required 200-level courses in Religion', '', 'One 200-level Religion designated course', 'Religion perspective\r\nAAAW perspective', 'None', '1', 0),
(97, 'WGS', 477, 201912, 'Q', 20, 'Feminist & Queer Dis/Ability Studies', NULL, 'steeles', NULL, 0, 1, 2, '', 'This course explores discourses and experiences of identity, difference, and power from the lens of Feminist Dis/Ability Studies. As an emergent field of Women’s and Gender Studies, Feminist Dis/Ability Studies strives to unsediment our hegemonic notions of able-bodied-ness and neurotypicality. Which is to say, this class will denaturalize and depathologize disability by examining patterns or performativities that unsettle the ability/disability binary. It will do so by focusing on intersectional experiences of women, trans, and gender non-conforming people who also struggle with dis/abilities. ', '', 'This class will count towards the WGS major, as a core course substitution.', '', 'This class will count towards the WGS minor, as a core course substitution.', 'AAAW', 'B', '1', 0),
(101, 'PSJ', 1273, 201912, 'I', 16, 'Restorative Justice', 'Actual instructor will be Jeff From (Jason Strange will be on sabbatical), but Jeff is not currently in the system.', 'steeles', NULL, 0, 1, 2, '1.000', '', 'GSRT 210', 'Should meet a distribution requirement in the \"Building Peace\" category.', '', 'Should meet a distribution requirement in the \"Building Peace\" category.', '', 'None', '1', 0),
(103, 'PHI', 1224, 201912, 'F', 20, 'Hindu-Buddhist Philosophy', NULL, 'rameyj2', NULL, 1, 1, 2, '1.000', 'This course is a survey of the philosophical traditions of Vedic (“Hindu”) and Buddhist South and Southeast Asia.  Students will be introduced to some of the major schools of thought, central primary texts, important thinkers, and contemporary philosophical discussions through exploring and reflecting upon the debates between Vedic and Buddhist philosophers on topics such as the nature of the self, theories of consciousness, metaphysics, theories of knowledge, and philosophy of language. This is a reading intensive course. ', 'GSTR 210 or sophomore standing', 'Can count as a Required Distribution Courses', '', 'Can count as a Required Distribution Courses', '', NULL, '1', 0),
(104, 'PSJ', 404, 201912, 'Q', 15, 'Ethnographic Methods', NULL, 'steeles', NULL, 1, 87, 2, '1.000', '', '', '', '', '', '', 'None', '1', 0),
(105, 'CSC', 683, 201912, 'E', 18, 'Text Analysis and Cultural Exploration', NULL, 'rameyj2', NULL, 0, 1, 2, '1.000', 'A dive into the many different ways that computer science technology can be used to process text to answer deeper questions about the relationship between people and places in a community or organization. Students will explore many different tools available as parts of a system they will design and build that analyze literary text and archive repositories to answer these questions. ', 'CSC 226', 'It will apply as an upper level distribution course under the Design category of the CIS major, all concentrations.', 'It will apply as an upper level distribution course under the Design category of the CIS major, all concentrations.', 'It will satisfy as one of the additional CSC courses, at the 300 level or above.', '', NULL, '1', 0),
(106, 'AST', 492, 201912, 'F', 20, 'Hindu-Buddhist Philosophy (PHI)', NULL, 'rameyj2', NULL, 1, 1, 2, '1.000', 'This course is a survey of the philosophical traditions of Vedic (“Hindu”) and Buddhist South and Southeast Asia.  Students will be introduced to some of the major schools of thought, central primary texts, important thinkers, and contemporary philosophical discussions through exploring and reflecting upon the debates between Vedic and Buddhist philosophers on topics such as the nature of the self, theories of consciousness, metaphysics, theories of knowledge, and philosophy of language. This is a reading intensive course. ', 'GSTR 210 or sophomore standing', 'Can count as a Required Distribution Course', '', 'Can count as a Required Distribution Course', '', 'None', '1', 0),
(107, 'CSC', 480, 201912, 'P', 14, 'Human-Centered Computing', NULL, 'rameyj2', NULL, 0, 46, 2, '', 'Programmers can be magicians enabling computers to interact with humans in more natural, engaging, and fun ways. This course takes students through a human-centered technology design and innovation process, with a focus on creating interactive systems. Students will conduct user research, identify a key problem, and develop technical solutions. Building on existing programming skills, students will be challenged to integrate an advanced interaction feature into their solutions, such as image recognition, voice interfaces, or streaming data.', 'CSC 236', 'Design Category', 'Design Category', '300+ Level or above', '', 'A', '1', 0),
(108, 'PSY', 506, 201912, 'I1', 12, 'Developmental Psychology w/Lab', 'The course will make regular classtime visits to the CDL for observational research.', 'steeles', NULL, 0, 1, 2, '1.000', 'A study of advanced social, cognitive and emotional development in infants and children.', 'PSY 100', 'This course will have the lab designation and count as one of the two required labs for the major.', '', '', '', 'None', '1', 0),
(109, 'REL', 1293, 201912, 'J', 17, 'Theories and Theologies of Forgiveness', 'This course will be taught by Leonard Curry.\r\n This course will be cross listed with AFR.\r\n', 'steeles', NULL, 0, 32, 2, '1.000', 'The course does not assume that people should or should not forgive.  The approach is phenomenological, attempting to understand/describe that people have forgiven, or do/did not, and how such unforgiveness/forgiveness was conceptually possible or justified.', 'GSTR 210', 'Completion of this course would meet the requirement of one course in Area III (Normative Studies).', '', '', 'Religion perspective', 'None', '1', 0),
(110, 'EDS', 697, 201912, 'J', 20, 'Classroom Application Technology', NULL, 'steeles', NULL, 0, 1, 2, '1.000', 'Introduces the theory and practice of instructional technology, the history of\r\nthe field, and current trends and issues. Students will be introduced to current educational technology hardware, software, and research-based\r\npractices that seek to have a positive impact on teaching and learning in diverse settings and with diverse populations. Students will explore\r\nlesson design and alignment with technology to develop student-centered lesson plans in which technology is used as a tool for learning rather\r\nthan as a delivery mechanism. Students develop competencies in educational technology appraisal, selection, development and application of \r\nmultimedia to support instruction and assessment purposes in K-12 classrooms. The application of instructional technologies will be based on an\r\neducational approach called Project-Based Learning (PBL). This course includes 10 hours of Clinical Field Experience.', 'EDS 150', '', '', '', '', 'None', '1', 0),
(111, 'APS', 546, 201912, 'Q', 12, 'Appalachian Ceramics', NULL, 'steeles', NULL, 0, 42, 2, '', '', '', '', '', '', '', 'None', '1', 0),
(112, 'HIS', 271, 201912, 'C', 15, 'Women’s Health and Healing, 1800 to Present ', NULL, 'steeles', NULL, 0, 16, 2, '1.000', 'From herbalists and midwives to nurses and OBGYNs, this course examines the historical relationship between women, health, and healing. We will use women who have worked as healers in the past as our guides through the diseases, conditions, and practices that have been cast as “women’s health” issues throughout the nineteenth and twentieth centuries. This course examines the ways a longstanding association between women as nurturers and healers and informal or unpaid healing work in many societies has given way to expanded options for women in the nursing and medical professions, while paying special attention to the exclusions and compromises this process has entailed. Topics covered will range from little-known maladies of the past—neurasthenia and the perils of wearing corsets—to issues women still face, such as maternal mortality, childbirth complications, sexual transmitted infections, and eating disorders. ', '', '•  Counts as one (1) of the seven (7) additional HIS course credits history majors need in addition to the major’s two (2) required courses', '', '• Counts as one (1) of the four (4) additional HIS course credits history minors need in addition to the minor’s one (1) required course', 'AAAW', 'None', '1', 0),
