(118, 'AFR', 521, 201912, 'J', 14, 'Readings in Moorish History ', 'Frost 8 or 102 preferred ', 'rameyj2', NULL, 1, NULL, 2, '', 'For nearly 8 centuries African Muslims known as “Moors,” resided within the borders of Christian Europe. Between 711-1492, the Moors intermarried with, governed, culturally influenced, and were eventually persecuted by their Catholic neighbors and kinfolk. Their primary historical association with Europe, when applied at all, is largely confined to the Iberian peninsula- today being the countries of Spain and Portugal.  Yet, the legacy of the Moorish presence goes well beyond that of Iberia, extending into other European countries such as Britain, France, and Italy.  This course is intended to introduce students to the broad historical impact which the Moors had upon Western culture and European history. It will not only address the key areas of Moorish historical contributions, but also the highly revealing lessons of historiography. The fact that the Moors are customarily presented as “Arabs” in most Western historical treatments, rather than as the predominantly African (largely “Amazigh”) people which they were, is one of the areas which our course will assess. Fortunately there has been an increase in the past decade or so, concerning the awareness of the favorable Moorish impact upon the rise of the sciences in the West, the university system, and Europe’s cultural ascension in general. Documentaries like those narrated by Dr. Bettany Hughes “When The Moors Ruled Europe” (2005) have brought greater light upon this period in European history, a period which is arguably as important in advancing European civilization as was that of the Greeks. This class will further the cause of this renewed consciousness by looking into the various aspects of the Moorish/African/Afro-Asiatic legacy.', 'HIS 101; HIS/AFR 260; or Permission of the Instructor', '', '', '', 'International (Non-Western) ', 'B', '1', 0);
