(119, 'COM', 661, 201912, 'J', 12, 'Digital Editing', NULL, 'rameyj2', NULL, 0, NULL, 2, '1.000', 'The purpose of Digital Editing is to introduce students to the theory of motion picture editing and to provide beginner-level technical training for putting that theory into practice. In addition to working with motion pictures, some time will be spent discussing and exploring digital audio editing.', 'none', 'Communication: Fulfills requirements for one of two elective course credits.', '', 'Communication: Fulfills requirement for one of three elective course credits.\r\nBroadcast Journalism: Fulfills requirement for one of three elective course credits.\r\nFilm Production: Fulfills requirement for one of two elective course credits.\r\n', '', 'None', '1', 0),
(120, 'COM', 114, 201912, 'K', 20, 'Race, Gender, and Media', 'media access', 'rameyj2', NULL, 1, 31, 2, '1.000', 'This class explores the historical and current roles of race and gender in a range of U.S. media industries (entertainment, journalism, marketing/advertising, and public relations) with an emphasis on critical analysis, advocacy, and activism.  Readings and course work guide students toward becoming engaged media consumers and producers.', 'GSTR 210', 'Group 1', '', 'COM course elective', '', 'None', '1', 0),
(121, 'AFR', 524, 201912, 'B', 20, 'Black Power Beyond Borders', 'Frost classroom preferred', 'rameyj2', NULL, 1, NULL, 2, '', 'Where, when, and what was the civil rights movement? What were its goals and who deserves credit for its successes and failures? This course will expand the traditional narrative of the American civil rights movement geographically, temporally, and in terms of the actors involved. We will debate the current understanding of the civil rights movement as (1) both efforts in the United States and social and political struggles who inspired and were inspired by the Black Freedom Struggle in other parts of the world, (2) the relationship between events in the 1950s and 1960s with events both earlier and later, (3) how grassroots struggle of countless individuals related to the perceptions of leaders within representative movements. We will probe how to best understand the movement of ideas and actions across time, social movements, and national borders. Topics will include the transnational dimensions of anti-slavery movements, white supremacy, and Pan-Africanism; Marcus Garvey’s UNIA; the influence of Gandhian nonviolent civil disobedience on the Black freedom struggle; African American responses to the Italian invasion of Ethiopia; the racial dimensions of the First and Second World Wars; African American engagement with decolonization in Africa and revolutionary change in China, Cuba, Vietnam and elsewhere; and the global legacy of Black Power', '', 'Social Science Area Distribution Course', '', 'Distribution Course', 'AAAW Perspective', 'A', '1', 0),
(122, 'AFR', 521, 201912, 'Q', 20, 'Endless Conundrum: Black Women Artists and 20th/21st Century Visual Culture', 'Rogers-Traylor or Draper classrooms preferred', 'rameyj2', NULL, 1, NULL, 2, '', 'This course investigates the work and working context of late 20th and early 21st Century Black women artists. With attention not only to black women’s traditions of artistic production, but also to black women’s historical position within visual culture and discourse, we will explore the ways art and visuality can surface and respond to various interlocking issues for black women. Throughout the course, we will explore black women’s artful interventions into questions of race, diaspora, history, economy, knowledge, beauty, body, respectability, sex and desire, categories of the human, violence and injury, and the radical business of everyday life. Calling on black feminist theory, art history, visual culture theory and the critical voices of scholars like Michelle Cliff, Glenda Carpio, Michael Harris, Saidiya Hartman, and Angela Davis, we will place these artists and their works into temporal and thematic context, exploring the interventions they make into understanding and, sometimes, radically altering the world around them.', '', 'Humanities Area Distribution Course', '', 'Distribution Course', 'AAAW, Art', 'A', '1', 0),
(123, 'AFR', 2, 201912, NULL, 24, 'Model African Union', 'PLEASE SCHEDULE FOR 5:00-6:30PM (time unavailable in standard schedule)', 'rameyj2', NULL, 1, NULL, 2, '0.500', 'Berea’s Model African Union (MAU) Team represents about three countries at the International MAU competition in Washington, D.C. each February.  To prepare, over the Winter break, each of you will research and write a paper about your country and its approach to your topic: Peace & Security; Economic Matters; Social Matters (education, health, etc.); Democracy, Governance, & Human Rights; etc.  In January and the first half of February, you will learn more about your country and your topic.   You will also practice drafting, debating, and synthesizing proposals related to these topics so that you can submit a high-quality proposal to the International MAU.  In mid-February, at the International MAU Conference, you will join students from colleges throughout the U.S., Canada, and Africa in debating and refining these policy proposals.  You will also get to visit your country’s embassy and speak with its ambassador and/or diplomats.  Finally, you will help compile the best proposals into a document that will be submitted to the actual African Union in Ethiopia.  The course work will be finished before the end of February.', 'Permission of instructor', '', '', '', '', 'A', '1', 0),
