(130, 'AFR', 521, 201912, 'U', 15, 'The Study of Ritual', NULL, 'rameyj2', NULL, 1, NULL, 2, '1.000', 'An introduction to the study of religious ritual.  Through case-studies of Christian and indigenous religious practices in Africa, this course will explore both the nature of religious ritual and types of religious rituals, considering both theories of ritual and methods for the study of ritual.  Inquiring about the nature of ritual as both symbol and performance, the course will examine the relationships among ritual, sacred narratives or stories, music, art, and sacred time and space.  This course will employ anthropological and theological models of human action to analyze how performance of rituals both establishes and expresses the cultural identities of religious communities.', 'GSTR 110', 'It would be one of the 200-level REL courses required for a major in Religion.', 'It will meet the requirement that a Religion major take one course in Cultural Studies of Religion.', 'It would meet the requirement of one 200-level REL course required for the minor in Religion.', 'Religion and International (Non-Western) - pending approval', 'None', '1', 0),
