(137, 'EDS', 698, 201912, 'ZZZ', 16, 'Intro to Foreign Language Learning & Teaching', 'MF 8-9:50', 'hartlepn', NULL, 0, NULL, 1, '1.000', 'This course intends to help students develop (1) an inter-disciplinary understanding of the role language plays in human communication, (2) basic skills of teaching English to speakers of other languages, and (3) a better knowledge of the English language. This will be achieved through reading, talking, and hands-on activities, including making, implementing and evaluating lesson plans and course materials, observing language learners, reporting and reflecting on teaching and observations. ', '1 year of foreign language learning', '', '', '', '', 'None', '1', 0),
