(141, 'PSJ', 1273, 202011, 'Q', 15, 'A Latinx/PSJ course to be developed by Gwen', 'Title: Latinx Migrations to the U.S.', 'addisonj', NULL, 0, 1, 2, '1.000', 'In this course, we will explore the origins/processes of migration and the current and past lived experiences of Latin American and Caribbean migrants in the United States. In doing so, we will relate migration with larger global, imperial, and/or colonial socio-economic forces. We will address the following themes: immigrant community formation and acculturation, racism and xenophobia, labor, gender and sexuality, border and immigration enforcement, and the immigrant justice movement.\r\nThis course is inter-disciplinary and will provide canonical and alternative readings from Latino and Latin American Studies, immigration studies, anthropology, and other social science and humanities fields.\r\n', '', '', '', '', '', 'None', '1', 0),
