(148, 'WGS', 477, 202011, 'Q', 20, 'Institutionalization of Trans and Queer Studies', NULL, 'malakloum', NULL, 0, 1, 1, '1.000', 'Although transgender studies and queer studies have only recently begun being institutionalized within the academy, they emerged as distinct fields in the late 1990s after the publication of Sandy Stone’s “The Empire Strikes Back: A Posttranssexual Manifesto.” Almost twenty years later, in the inaugural issue of Transgender Studies Quarterly (TSQ 1(1/2), 2014), Sandy Stone cautions that the institutionalization of transgender studies could be the impetus to depolitize the movement for trans and queer lives through the necessity to follow the guidelines of the academy. In this course, we will take Stone’s caution seriously as we critically read, analyze, and write about the texts that are forming the trans and queer \"canon.” We will read articles from Sandy Stone, Susan Stryker, Dean Spade, C. Riley Snorton, Emi Koyama, Eli Clare and many others.', 'None', '', '', '', 'AAAW', 'A', '1', 0),
(154, 'AFR', 521, 202011, 'E', 20, 'Black and Indigenous Appalachia', NULL, 'addisonj', NULL, 1, 1, 2, '', 'This course explores the social, political, economic, cultural experiences, and interactions of African Americans and Indigenous Peoples in Appalachia from the beginning of European invasion and settlement to the contemporary era. The course engages students in developing an understanding of the historical experiences of African Americans and Indigenous communities in Appalachia, the discussion of issues such as the images and stereotypes of Appalachians, “Indians,”  and African Americans, and the examination of migratory patterns, education, labor organization, as well as the removal, and erasure of Indigenous Nations. The course places special emphasis upon the interaction and convergence of a distinctly Appalachian experience among and between African Americans and Indigenous Peoples from the region. ', 'None', 'Social Science Area Distribution Course', 'None', 'Distribution Course', 'AAAW', 'A', '1', 0),
(155, 'AFR', 521, 202011, 'Q', 15, 'Black Queer Theory', NULL, 'addisonj', NULL, 1, 1, 2, '', 'This course not only explores theories of gender, sexuality, and desire as they intersect with blackness, but also the ways that a black queer theoretical framework offers important political and intellectual answers to questions about black affect (feeling), epistemology (knowledge/thought), space and geography, family, embodiment, and the law. Together we will answer questions like How does race complicate questions of gender, sex, and sexuality? And how do sex and gender inform the business of race? What different formations of black queer relationality, eroticism, and kinship might be found in black culture? How does the project of nation-building also organize normativity, especially around race, gender, sexuality, and body? How have scholars both critiqued and mobilized the language of queer in considering larger questions of black marginality and resistance? And finally, what are the stakes of visuality/visibility for black queer people? Texts by foundational and emergent black queer studies scholars will be explored.', 'None', 'Humanities Area Distribution Course', 'None', 'Distribution Course', 'AAAW', NULL, '1', 0),
(156, 'AFR', 524, 202011, 'K', 15, 'Advanced Seminar in African & African American Studies: Emergent and Foundational Black Thought', NULL, 'addisonj', NULL, 0, 1, 2, '', 'This course is designed to provide students with an advanced-level survey of African & African American Studies. Building from ideas developed in AFR 222 and AFR 165, this course will explore various theoretical movements and frameworks that frame African & African American Studies as an inter-disciplinary field. Together we will critically explore Black Studies’ engagement with gender and sexuality, radical economy, environment or “ecocriticism,” affect, subjection and subjectivity, racial formation and interracial encounters, post-colonialism, structural oppression, political practice, visual and sonic theory, space and geography, temporality, materialism, species/Animal-Studies, ontology, epistemology, and method. This course will also be designed to help students translate their built expertise and make it “usable” for their careers and for movement in the world around them.     ', 'AFR 222 and AFR 165 (may be taken concurrently)', 'Required Core Course AFR 350 and Required Capstone Course AFR 450 \r\n(substitution for AY 20-21 ONLY)\r\n', 'None', 'Distribution Course', '', NULL, '1', 0),
(157, 'COM', 114, 202011, 'K', 20, 'Business Communication', 'media equipment', 'addisonj', NULL, 0, NULL, 2, '1.000', 'The way we engage in self-presentation and interaction varies depending on our circumstances. In this course, students will practice the skills needed to transition from undergraduate studies to professional life. You will have the opportunity to begin developing an electronic professional portfolio including resumes, cover letters, work samples, award certificates, etc. and practice interviewing and business-related interpersonal communication and presentation skills. Each student will engage in critical thinking and problem solving to strategically write e-mails, memos, proposals, and reports as well as engage in face-to-face meetings to influence effective and helpful responses from co-workers, employees, employers, and clients.', '', 'Group 2 distribution', '', 'Distribution courses', '', 'None', '1', 0),
(158, 'HHP', 258, 202011, 'C', 20, 'Movement for Emotional Regulation', 'Seabury Dance Studio & Indoor Track', 'magnerl', NULL, 0, 61, 0, '0.250', '', 'None', '', '', '', '', NULL, '1', 0),
(159, 'HIS', 278, 202011, 'E', 15, ' Black and Indigenous Appalachia', NULL, 'addisonj', NULL, 1, 1, 2, '', 'This course explores the social, political, economic, cultural experiences, and interactions of African Americans and Indigenous Peoples in Appalachia from the beginning of European invasion and settlement to the contemporary era. The course engages students in developing an understanding of the historical experiences of African Americans and Indigenous communities in Appalachia, the discussion of issues such as the images and stereotypes of Appalachians, “Indians,”  and African Americans, and the examination of migratory patterns, education, labor organization, as well as the removal, and erasure of Indigenous Nations. The course places special emphasis upon the interaction and convergence of a distinctly Appalachian experience among and between African Americans and Indigenous Peoples from the region. ', '', '•  Counts as one (1) of the seven (7) additional HIS course credits history majors need in addition to the major’s two (2) required courses\r\n• Counts as one (1) course credit to fulfill the American Distribution requirement within the major, and inside that distribution, it counts as one (1) African American history course\r\n•  Counts as an HIS elective at the 200-level or higher', '', '• Counts as one (1) of the four (4) additional HIS course credits history minors need in addition to the minor’s one (1) required course', 'AAAW', 'None', '1', 0),
(162, 'CSC', 499, 202011, NULL, 16, 'Science Fiction, Technology, and Society', 'Cross-listed as ENG 286', 'addisonj', NULL, 1, 1, 2, '1.000', 'Computers and technology have become woven into the fabric of our everyday lives, even transforming the way we interact with other humans on a day-to-day basis. But, how often do we stop to think about the ethical implications of the technologies we design, create, and use for so many of our interactions? The genre of science fiction has long been imagining the social and ethical implications of technological innovation. What might science fiction teach us about how technology impacts people and society?  In this course, we will use science fiction to help us think critically about contemporary issues and questions related to: labor and computing, medical technology, privacy and security, civic participation and politics, virtual and augmented reality, social media, and sustainability in computing, among other topics. Students will be introduced to basics of computational thinking, literary analysis, and narrative creation. Ultimately, students will craft their own interactive stories that are inspired and informed by course readings and class discussions.', '', '(CS) Exploratory Distribution\r\n(ENG) Fulfills one course for the ENG distribution', '“English General”', 'Computer Science minor\r\nEnglish minor (fulfills one required distribution course)\r\n', 'Practical Reasoning\r\nArts ', 'A', '1', 0),
(165, 'SOC', 1327, 202012, 'PA', 16, 'TBA', 'Taught by new instructor - Christian Smith. ', 'woodwarda', NULL, 0, 22, 0, '', '', '', '', '', '', '', 'None', '1.0', 1),
(167, 'HIS', 271, 202011, 'B', 15, 'Worlds of the Middle Ages', 'Taught by Dr. Mireille Pardon. (Reserve 10 seats for first year students.)', 'addisonj', NULL, 0, 1, 2, '1.000', 'This course covers over a thousand years of European history, roughly 300-1500 AD, from late antiquity to the Protestant Reformation. The medieval period began in the final gasp of the Roman Empire and saw the rise of medieval courts, with their kings, queens, and knights, Gothic cathedrals, illuminated manuscripts, and cloistered nuns and monks, before ending on the eve of the Age of Exploration. While tracking the major political, economic, and cultural developments of the medieval world, this class discusses the christianization of Europe and the rise of Islam in the Middle East, feudal relationships and urbanization, monasticism and Papal power, scholasticism and heresy, as well as the everyday life of men and women in pre-industrial Europe.', '', '• Counts as one (1) course credit toward the Regional History (European) distribution in the History major\r\n• Counts as one (1) course credit towards  the Pre-1700 distribution in the History major\r\n•  Counts as one (1) of the seven (7) additional HIS course credits history majors need in addition to the major’s two (2) required courses\r\n', '', 'MINOR requirements met with this course	• Counts as one (1) of the four (4) additional HIS course credits history minors need in addition to the minor’s one (1) required course', 'Western History', 'None', '1', 0),
(168, 'HIS', 278, 202011, 'K', 12, 'Medieval Travel', 'Taught by Professor Mireille Pardon', 'addisonj', NULL, 0, NULL, 2, '1.000', 'This course examines the movement of people, goods, and ideas in the Middle Ages, both within Europe and to/from the rest of the world. In addition to travel narratives that pushed the boundaries of the ‘known world,’ such as Marco Polo and Ibn Battuta, this class examines religious pilgrimages, both penitential and voluntary, as well as established trade routes, from the Silk Road to the Hanseatic League. Not all journeys were physical: holy men and women made otherworldly mystical journeys and ghostly visitors warned of the horrors of purgatory. While some journeys were enriching, bringing scientific, medical, and technological advancements to Europe, others were destructive, such as the military expeditions of the Crusades. Though globalization is a buzzword of the modern world, connections and exchange enriched medieval society as well.', '', 'MAJOR requirements met with this course	•  Counts as one (1) course credit towards the Pre-1700 distribution in the History major\r\n•  Counts as one (1) course credit towards the Global history distribution in the History major\r\n• Counts as an HIS elective at the 200-level\r\n• Counts as one (1) of the seven (7) additional HIS course credits history majors need in addition to the major’s two (2) required courses\r\n', '', '• Counts as one (1) of the four (4) additional HIS course credits history minors need in addition to the minor’s one (1) required course', '', 'A', '1', 0),
