(176, 'HIS', 271, 202020, '9N', 12, 'Introduction to Global History', 'This class will meet Monday and Thursday only.', 'addisonj', NULL, 0, NULL, 2, '', '', 'GSTR 110', '', '', '', '', 'A', '1.0', 1),
(177, 'WGS', 477, 202012, '94', 20, 'Gender, Sexuality, & BLM', NULL, 'addisonj', NULL, 1, NULL, 2, '', 'This course will introduce students to articulations of racial blackness that destabilize binary notions of gender and sexuality. It will ask how discourses of modernity and humanism have excluded black persons from human recognitions and protections, including human markers of identity and difference like gender and sexuality. Students will ask how black lives can matter, if at all, and will further deliberate how black lives might be sexed and/or gendered—in ways that do not re/produce the heteronormative, binary model of Western metaphysical thought. The Black Lives Matter movement is hence rephrased in this class as a question for feminism about the limits of the Western metaphysical philosophy on which its claims on behalf of (white) women rest. Some of the questions we will consider include: Do black lives matter? Can life matter if it is black? How is black life gendered and/or sexed (in the second instance) if human recognition is revoked for black persons (in the first instance)?', 'None', '', '', '', '', 'B', '1.0', 1),
(178, 'AFR', 521, 202020, '94', 15, 'Carceral States: Race and the Struggle Against Prisons and Policing ', NULL, 'addisonj', NULL, 1, NULL, 2, '', 'While popular films like 13th and texts like The New Jim Crow have attempted to distill the role of race in the buildup of what Beth Ritchie calls the “Prison Nation,” this course will offer students a far deeper understanding of how race, gender, class, and sexuality all inform mass incarceration and the logics of policing and punishment. Alongside our examination of race, gender, and class criminalization, we will also study crucial touchpoints of the prison nation’s buildup and the intricacies of its enactments. Beyond attending to the impacts of the carceral state, we will also explore various resistance movements, including the Black Intellectual Prison Tradition, anti-carceral feminism, radical budget review, prison abolition, and queer and trans struggle against police and prison violence.  ', 'None', '', '', '', '', 'A', '1.0', 1),
(180, 'AFR', 524, 202020, '9Y', 20, 'The World Turned Upside-Down: Atlantic World Revolutions', NULL, 'addisonj', NULL, 1, NULL, 2, '', 'This course examines the revolutions that the spread across the Atlantic World from the mid-18th to the mid-19th century, a period some have called the “Age of Revolutions.” The primary focus is exploring the “successful” revolutions of the era: the American Revolution for independence from British rule, the French Revolution, the revolution in Saint-Domingue (the Haitian Revolution) that overthrew both French and white planter rule. Through discussion of these revolutions we will investigate ideas of freedom, unfreedom, and slavery. Colonial and anti-colonial relationships, and the transformation and transmission of ideas. ', 'AFR 165 or HIS 200, or permission of instructor', '', '', '', '', NULL, '1.0', 1),
(183, 'CFS', 639, 202020, '9V', 16, 'Infancy Intervention, Caregiving, and Curriculum', 'Can count as a distribution class for the child development concentration.', 'addisonj', NULL, 0, NULL, 2, '', 'This course will examine how to provide developmentally appropriate care for children, birth through 2 years. Students will explore how to provide enriching experiences in both the home environment and the classroom setting through embedded learning within daily routines. We will examine evidence-based practices to support children and families. The course will include intervention with children and families considered to be at-risk due to biological or environmental circumstances.', 'CFS 130 or permission of instructor', '', '', '', '', 'A', '1.0', 1),
(186, 'CSC', 683, 202012, '9L', 14, 'Human-Centered Computing', NULL, 'addisonj', NULL, 0, NULL, 2, '', 'Programmers can be magicians enabling computers to interact with humans in more natural, engaging, and fun ways. This course takes students through a human-centered technology design and innovation process, with a focus on creating interactive systems. Students will conduct user research, identify a key problem, and develop technical solutions. Building on existing programming skills, students will be challenged to integrate an advanced interaction feature into their solutions, such as image recognition, voice interfaces, or streaming data.\r\n', 'CSC 226 or CSC 236 with a C- or better.', '', '', '', '', 'None', '1.0', 1),
(187, 'CSC', 480, 202020, '9N', 14, 'Computing Design Practicum', 'This course SPANS the entire 14 week term. ', 'addisonj', NULL, 0, NULL, 2, '', 'A course on software project development, the students will develop habits of mind to design and fully implement a working system using the Agile development framework. They can expect to employ iterative design and prototyping, regularly report progress throughout the term, and present their system in a poster session at the end. They will also work on activities to bridge out of college and into industry or advanced degrees.', 'Senior Standing and CSC236 and CSC 486 in Spring A', '', '', '', '', 'A', '1.0', 1),
(188, 'BUS', 619, 202020, 'PA', 15, 'Lean Processes', NULL, 'addisonj', NULL, 0, NULL, 2, '', '', 'GSTR 210', '', '', '', '', NULL, '1.0', 1),
(189, 'COM', 114, 202020, 'ZZZ', 20, 'Health Communication', 'Time: Tues 10-11\r\nThis should be crosslisted with HLT, as per the special topics form', 'addisonj', NULL, 0, NULL, 2, '', 'Our individual health is influenced by our interpersonal relationships, media, public health initiatives, culture, and health care providers. At the core of these influential moments is communication. This course will help you develop a better understanding of how health communication concepts, theories, research methods, cases, and other practices are applied in addressing real-world health issues and problems. Each student will have the opportunity to gain a deeper understanding of the field of health communication, learn about health communication approaches and action areas, and plan, implement, and evaluate their own health communication intervention. This intervention can be used to supplement your professional portfolio.', 'None', '', '', '', '', 'None', '1.0', 1),
(190, 'GST', 179, 202012, NULL, NULL, 'Graduate School Prep (title comming)', 'Grad School Prep form coming.  Thursday 4-5:50. ', NULL, NULL, 0, NULL, 1, '', '', '', '', '', '', '', '', '1.0', 1),
(191, 'AFR', 521, 202020, '95', 20, 'Black Feminist Theory ', 'Cross list with WGS.', 'addisonj', NULL, 1, NULL, 2, '', 'This course explores contemporary and foundational Black Feminist thought. Throughout the class, we will examine several traditions of Black Feminism, discovering how each tradition intervenes into hegemonic knowledge systems, provides models of political and everyday practice, and offers new ways to analyze the world around us. We will pay special attention issues that have been particularly important to foundational and emerging Black Feminism including: labor and economy, nationalism, carcerality, the politics of sexuality, embodiment, and relationship, the politics of respectability, intersectionality and standpoint theory, reproductive justice, environmental justice, and the everyday business of survival. ', '', '', '', '', '', 'None', '1.0', 1),
(192, 'CSC', 499, 202020, '9J', 14, 'Intro to Web Development', '1 senior; 1 junior; otherwise unrestricted. \r\nNote this is course is non-credit for students who have completed CSC 236.', 'addisonj', NULL, 0, NULL, 2, '', 'CSC186 Web Development introduces students to creative web development. Students will design and implement web applications that separate structure, presentation, and interaction using standards-based HTML, CSS, and JavaScript respectively. Students will compare strengths and weaknesses of web development versus other development platforms.\r\n\r\nNote this is course is non-credit for students who have completed CSC 236.', 'Developmental Math MAT 012 passed or waived', '', '', '', '', NULL, '1.0', 1),
(193, 'HHP', 258, 202012, '9B', 12, 'OPEN Taskmaster', NULL, 'addisonj', NULL, 0, NULL, 2, '', 'The Online Physical Education Nexus (OPEN) Taskmaster course focuses on elementary to adult activities with a focus on the six health-related skills of fitness (agility, balance, coordination, power, speed and reaction time) in which students will participate in weekly activities such as Pilates, aerobics, core workouts and line dances for example. The Taskmaster portion encompasses the intellectual and physical dimensions of wellness by encouraging students to think creatively and laterally in game-like challenges that can be completed with common household items. Students taking this course will assess their own health-related skills of fitness and design tasks for others using common household items. ', '', '', '', '', '', 'A', '0.25', 1),
(194, 'ARH', 487, 202112, 'ZZZ', 16, 'Latinx Art History', 'M/W 9:20-11:10', 'steeles', NULL, 0, NULL, 2, '', '', 'GSTR 110', '', '', '', '', 'None', '1.0', 0),
(195, 'ARH', 574, 202112, NULL, 8, 'Advanced Research in Archaeology', NULL, 'steeles', NULL, 0, NULL, 2, '', '', '', '', '', '', '', NULL, '1.0', 0),
(196, 'WGS', 477, 202111, 'E', 20, 'The Institutionalization of Queer and Transgender Studies', 'This course is being revised as WGS 200: The Institutionalization of Queer & Transgender Studies. Curricular revisions will go into effect (if approved) in Fall 2021.', 'steeles', NULL, 0, NULL, 2, '', '', '', '', '', '', '', NULL, '1.0', 0),
(197, 'WGS', 479, 202111, 'J', 10, 'Intersectionality and its Dis/Contents', 'This course is being revised as WGS 450: Capstone: Intersectionality and its Dis/Contents. Curricular revisions will go into effect (if approved) in Fall 2021.', 'steeles', NULL, 1, 28, 2, '', '', '', '', '', '', '', 'None', '1.0', 0),
(199, 'REL', 1301, 202112, 'K', 20, 'Viking Age Norse Religion', 'No cross listing with the Department of History.\r\n\r\nNeed ten extra minutes: 4:00 to 6:00 p.m.', 'steeles', NULL, 0, 37, 2, '', 'Survey of Medieval Norse Religion', '', '', '', '', '', 'A', '1.0', 0),
