(203, 'HIS', 840, 202111, 'J', 12, 'The Queer Middle Ages', 'Frost 106 or 211', 'steeles', NULL, 0, 20, 2, '', '', '', '', '', '', '', 'None', '1.0', 0),
(206, 'HIS', 271, 202112, 'C', 20, 'Medieval Animals', NULL, 'steeles', NULL, 0, 17, 2, '', '', '', '', '', '', '', 'None', '1.0', 0),
(208, 'EDS', 698, 202111, 'H', 15, 'Contemplative Pedagogy', 'Prerequisite: GSTR 210', 'steeles', NULL, 0, NULL, 2, '', '', 'GSTR 210', '', '', '', '', 'None', '1.0', 0),
(209, 'HIS', 271, 202112, 'I1', 15, 'Reacting to the Past', 'Save eleven seats for first-years.', 'steeles', NULL, 0, 9, 2, '', '', '', '', '', '', '', 'None', '1.0', 0),
(210, 'AFR', 521, 202111, 'J', 15, 'Rhetorics of Reproduction', NULL, 'steeles', NULL, 1, NULL, 2, '', 'Among few events all humans presume to hold in common is their embodied arrival on this planet, more plainly: their “birth.” The wild variation in contexts, conditions, and even imagined metaphysical properties of this arrival betrays any illusion of a static, common, or “neutral” understanding of this event. As such, ideas about reproduction - the processes, contexts, and meanings associated with making, having, and being new humans - are loaded with anxieties about gender, sexuality, race, the body, technology, futurity, religion, criminalization, and fundamental questions of “nature,” alongside that which constitutes the “normal.” \r\nIn this course, we’ll look at how tropes of reproduction - the moral mother, the vulnerable child, the populous earth, the autonomous body, artificial intelligence, and capacity for care - are deployed across various texts. We will also interrogate scholarship, art, news items, documentary film, historical documents, activist writing and other matter to consider how these deployments work to reveal, enable, or trouble multi-faceted dynamics of power.', 'N/A', '', '', '', '', NULL, '1.0', 0),
(211, 'AFR', 521, 202111, 'C', 20, 'Do No Harm?: A Black History of Medicine and Technology', NULL, 'steeles', NULL, 1, NULL, 2, '', 'This course examines how race, culture, and science have transformed medical and technological history from the period of enslavement to the present. Physicians, scientists, social scientists, and historians have had a long and complicated history with the construct of race. Although we have relegated controversies such as eugenics to the dustbins of history as evidence of science’s racist past, we would be foolish to think that science and technology always move forward toward greater and greater enlightenment. Racist ideas about group difference persist in the ways we conceptualize and conduct scientific investigations and in how we implement clinical practice or understand and interface with technology. ', 'N/A', '', '', '', '', NULL, '1.0', 0),
(212, 'AFR', 521, 202111, 'J', 20, 'African Presence in Early Europe', NULL, 'steeles', NULL, 0, NULL, 2, '', '', '', '', '', '', '', NULL, '1.0', 0),
(213, 'AFR', 521, 202112, 'P', 20, 'African Presence in Latin America', NULL, 'steeles', NULL, 0, NULL, 1, '', '', '', '', '', '', '', NULL, '1.0', 0),
(214, 'EDS', 698, 202112, 'O', 20, 'Introduction for Foreign Language Learning and Teaching', NULL, 'hartlepn', NULL, 0, 66, 1, '', '', '', '', '', '', '', 'None', '1.0', 0),
(215, 'CFS', 639, 202111, 'P', 15, 'Childhood Assessment', NULL, 'steeles', NULL, 0, 10, 2, '', '', 'CFS 130,  GSTR 210', '', '', '', '', 'A', '1.0', 0),
(216, 'LES', 1454, 202111, 'L', 12, 'Legal Reasoning and Advocacy II', 'Submitted to meet PR perspective.', 'addisonj', NULL, 0, NULL, 2, '', 'Students will explore a complex case problem designed to simulate the appeal of a\r\nproceeding via a writ of certiorari to the Supreme Court of the United States (SCOTUS).', 'LES 215', '', '', '', '', NULL, '1.0', 0),
(217, 'CFS', 639, 202111, 'P', 15, 'Developmental Observation and Assessment of Young Children', NULL, 'steeles', NULL, 0, 10, 2, '', 'This course is designed to help students gain knowledge and understanding of the purposes of assessment. Students will learn how to choose developmentally, linguistically, and culturally appropriate tools and methods that are responsive to the characteristics of young children and their families. Using evidence-based practices, students will develop or select, as well as administer, informal measures and select and administer formal measures in partnership with families and other professionals. Students will learn to analyze, interpret, document, and share assessment information, using a strength-based approach, with families and other professionals which might be used for: eligibility determination, outcome/goal development, planning instruction and intervention, monitoring progress, and reporting.', 'CFS 130', '', '', '', '', 'None', '1.0', 0),
(218, 'CSC', 683, 202111, 'Q', 20, 'Compiler Design and Implementation', 'Course description: Compilers are translators that convert programs from a source language to a target language. This course examines the principles of the design of compilers and their implementation.  This course is designed to count in the Systems area of the CIS major.\r\n\r\n(For the registrar: To be taught by Deanna Wilborne)', 'addisonj', NULL, 0, 46, 2, '', '', 'CSC 226', '', '', '', '', 'None', '1.0', 0);
